object.script:
Td = {0,0,0,0,0,0,0,0,0} Tx = {0,0,0,0,0,0,0,0,0} Ty = {0,0,0,0,0,0,0,0,0}
Td1 = {} Tx1 = {} Ty1 = {}
Tdold = {} Txold = {} Tyold = {}
kalman = 0.75
function onTick() lookX = input.getNumber(31) lookY = input.getNumber(32)
pov = property.getNumber("Seat center to HUD distance")
for i=1,8,1 do Tdold[i] = Td[i] Txold[i] = Tx[i] Tyold[i] = Ty[i] td = input.getNumber(i*4-3) --distance tx = input.getNumber(i*4-2) --azimuth ty = input.getNumber(i*4-1) --elevation for u in pairs(Tx) do if false and math.abs(td-Td[u])<10 and math.abs(tx-Tx[u])<0.05 and math.abs(ty-Ty[u])<0.05 and u~=i then td = 0 tx = 0 ty = 0 end end
Td[i] = td Tx[i] = tx Ty[i] = ty if Tdold[i]~=0 then Td1[i] = kalman*Td[i]+(1-kalman)*Tdold[i] Tx1[i] = kalman*Tx[i]+(1-kalman)*Txold[i] Ty1[i] = kalman*Ty[i]+(1-kalman)*Tyold[i] else Td1[i] = Td[i] Tx1[i] = Tx[i] Ty1[i] = Ty[i] end end end
function onDraw() w = 96 h = 96 screen.setColor(255, 255, 0)
modX = lookX*property.getNumber("X modifier") modY = lookY*property.getNumber("Y modifier")
count = 0
for i in ipairs(Tx1) do if Tx1[i]~=0.0000 and Ty1[i]~=0.0000 then count = count + 1 x=math.tan(Tx1[i]*2*math.pi)*pov*96 y=math.tan(Ty1[i]*2*math.pi)*pov*96
screen.drawRect(46+x+modX, 36-y-modY, 4, 4) end end
screen.drawText(2, 13, count) end

function onTick() isP1 = input.getBool(1) isP2 = input.getBool(2) Ammo = input.getNumber(string.format("%.0f", 1)) in1X = input.getNumber(3) in1Y = input.getNumber(4) in2X = input.getNumber(5) in2Y = input.getNumber(6)
end
function onDraw()
setC(0,96,0) screen.drawTextBox(57, 84, 24, 8, "AMMO", 0, 0)
screen.drawTextBox(81, 84, 20, 8, Ammo, 0, 0) end
function setC(r,g,b,a) if a==nil then a=255 end screen.setColor(r,g,b,a) end

function onTick() inputX = input.getNumber(3) inputY = input.getNumber(4) isPressed = input.getBool(1)
BRT = isPressed and isPointInRectangle(inputX, inputY, 9, 25, 13, 6) LEFT = isPressed and isPointInRectangle(inputX, inputY, 0, 25, 9, 6) RIGHT = isPressed and isPointInRectangle(inputX, inputY, 22, 25, 9, 6)
output.setBool(1, BRT) output.setBool(2, LEFT) output.setBool(3, RIGHT) end
function isPointInRectangle(x, y, rectX, rectY, rectW, rectH) return x > rectX and y > rectY and x < rectX+rectW and y < rectY+rectH end
function onDraw() w = screen.getWidth() h = screen.getHeight()
screen.setColor(0, 0, 0) screen.drawRectF(0, 25, 32, 10)
if LEFT then screen.setColor(0, 0, 0) else screen.setColor(2, 2, 2) end screen.drawRect(0, 25, 9, 6)
if BRT then screen.setColor(0, 0, 0) else screen.setColor(2, 2, 2) end screen.drawRect(9, 25, 13, 6)
if RIGHT then screen.setColor(0, 0, 0) else screen.setColor(2, 2, 2) end screen.drawRect(22, 25, 9, 6)
screen.drawRect(0, h, 1, -2) screen.drawRect(w, h, -2, -2)
screen.setColor(200, 200, 200, 200) screen.drawTextBox(1, 25, 8, 7, "<", 0, 0) screen.drawTextBox(11, 25, 12, 7, "+-", 0, 0) screen.drawTextBox(24, 25, 8, 7, ">", 0, 0) end
